function wdeTestOutComp(a, b, filter, testName, downloadDiff) {
    var aLib = a;
    var bCurr = b;
    if (filter == "GB_No_Date") {
        aLib = wdeTestRemoveDateGenbank(a);
        bCurr = wdeTestRemoveDateGenbank(b);
    }
    if (filter == "HTML") {
        aLib = wdeTestSortTagsHTML(a);
        bCurr = wdeTestSortTagsHTML(b);
    }
    
    var nowTime = new Date();
    var mSeconds = nowTime.getTime() - wdeTestLastTime.getTime();
    wdeTestLastTime = nowTime;
    if (aLib == bCurr) {
        wdeTestAddToOutput("[OK] - " + mSeconds + " ms\n");
        if (downloadDiff == 2) {
		    wdeInTestRun = 0;
		    if (filter == "HTML") {
		         aLib = aLib.replace(/</g, "\n<");
		         aLib = aLib.replace(/>/g, ">\n");
		         aLib = aLib.replace(/\n+/g, "\n");
		         bCurr = bCurr.replace(/</g, "\n<");
		         bCurr = bCurr.replace(/>/g, ">\n");
		         bCurr = bCurr.replace(/\n+/g, "\n");
            }
		    wdeSaveFile(testName + "_A_LIB.txt", aLib, "text");
		    wdeSaveFile(testName + "_B_CUR.txt", bCurr, "text");
		    wdeInTestRun = 1;
        }
    } else {
        wdeTestAddToOutput("[FAILED] - " + mSeconds + " ms\n");
        wdeTestFailed = 1;
        if (downloadDiff != 0) {
		    wdeInTestRun = 0;
		    if (filter == "HTML") {
		         aLib = aLib.replace(/</g, "\n<");
		         aLib = aLib.replace(/>/g, ">\n");
		         aLib = aLib.replace(/\n+/g, "\n");
		         bCurr = bCurr.replace(/</g, "\n<");
		         bCurr = bCurr.replace(/>/g, ">\n");
		         bCurr = bCurr.replace(/\n+/g, "\n");
            }
		    wdeSaveFile(testName + "_A_LIB.txt", aLib, "text");
		    wdeSaveFile(testName + "_B_CUR.txt", bCurr, "text");
		    wdeInTestRun = 1;
        }
    }
}

function wdeTestRemoveDateGenbank(txt) {
    var retTxt = "";
    var firstLine = 1;
    for (var i = 0 ; i < txt.length ; i++) {
        if ((txt.charAt(i) == "\n") &&
            (firstLine == 1)){
            retTxt = retTxt.replace(/[^\s]+\s*$/, "");
            firstLine = 0;
        }
        retTxt += txt.charAt(i);
    }
    return retTxt;
}

function wdeTestSortTagsHTML(txt) {
    var retTxt = "";
    var tagInfo = "";
    var inTag = 0;
    var tagName = 0;
    var tagArr = [];
    var inSpacer = 0;
    var eqalDetect = 0;
    var inQuot = 0;
    var firstTag = 0;
    for (var i = 0 ; i < txt.length ; i++) {
        if ((txt.charAt(i) == "<")){
            inTag = 1;
            tagName = 1;
            firstTag = 1;
            inSpacer = 0;
            eqalDetect = 0;
            tagInfo = "";
            tagArr = [];
        }
        if ((txt.charAt(i) == "\"") && 
            (txt.charAt(i - 1) != "\\")){
            if (inQuot) {
                inQuot = 0;
                eqalDetect = 0;
                inSpacer = 0;
            } else {
                inQuot = 1;
            }
        }
        if ((txt.charAt(i) == ">")){
            inTag = 0;
    	    if (firstTag == 1) {
                retTxt += tagInfo;
            } else {
                retTxt = retTxt.replace(/\s*$/, "") + " ";
                tagInfo = tagInfo.replace(/\s*$/, "");
	            if (tagInfo != "") {
                    tagArr[tagArr.length] = tagInfo;
                }
                tagArr.sort();
                for (var k = 0 ; k < tagArr.length ; k++) {
                    retTxt += tagArr[k].replace(/\s*$/, "") + " ";
                }
                retTxt = retTxt.replace(/\s*$/, "");
            }
        } else if (inQuot == 0) {
            if ((txt.charAt(i) == "=")){
                eqalDetect = 1;
                inSpacer = 0;
            }
	        if (/\s/g.test(txt.charAt(i))){
	            inSpacer = 1;
	        } else {
	            if ((inSpacer == 1) && (eqalDetect == 2)) {
                    eqalDetect = 0;
	            }
	            if ((inSpacer == 1) && (eqalDetect == 0)) {
	                inSpacer = 0;
	                if (firstTag == 1) {
		                retTxt += tagInfo;
		                tagInfo = "";
		                firstTag = 0;
	                } else {
	                    tagInfo = tagInfo.replace(/\s*$/, "");
	                    if (tagInfo != "") {
	                        tagArr[tagArr.length] = tagInfo;
		                    tagInfo = "";
		                }
	                }
	            }
	            if ((inSpacer == 1) && (eqalDetect == 1)) {
	                inSpacer = 0;
	                eqalDetect = 2;
	            }
	        }
            if ((txt.charAt(i) == "=")){
                inSpacer = 1;
            }
        }
        if (inTag == 0) {
            retTxt += txt.charAt(i);
        } else {
            tagInfo += txt.charAt(i);        
        }
        if ((txt.charAt(i) == "\"") && 
            (txt.charAt(i - 1) != "\\")){
            if (inQuot == 0) {
                tagArr[tagArr.length] = tagInfo;
		        tagInfo = "";
            }
        }
        
    }
    return retTxt;
}



